    const saveExpenseHandler = enteredExpenseData =>{
        newExpenseData = {
            ...enteredExpenseData,
            id: Math.random().toString()
        }

        console.log(newExpenseData);
    }

    return (
        <div className="new-expense">
            <ExpenseForm onSaveExpenseData={saveExpenseHandler}/>
        </div>
    )
}

